  Freedom of Information Act (FOIA) report includes detailed statistics on the number
  and disposition of FOIA requests, including response times, volume of requests,
  and personnel costs. This information is being presented in a machine-readable format
  that allows members of the public, including public interest organizations, scholars
  and the media, to track the Agency's performance. This set covers fiscal year 2009.
